```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    val sc = spark.sparkContext

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = sc.textFile("onsite_data.txt")

    // Load top frequent queries
    val topQueries: JavaRDD[String] = sc.textFile("top_queries.txt")

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = sc.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, Long] = mutable.Map()

    // Process onsite data
    val hitRate = onsiteData.map(line => {
      val query = line.split(" ")(0)
      val timestamp = line.split(" ")(1).toLong

      if (broadcastTopQueries.value.contains(query)) {
        if (cache.contains(query)) {
          // Cache hit
          if (timestamp - cache(query) <= 12 * 60 * 60) {
            (1, 1)
          } else {
            // Cache miss, update cache
            cache.put(query, timestamp)
            (0, 1)
          }
        } else {
          // Cache miss, update cache
          cache.put(query, timestamp)
          (0, 1)
        }
      } else {
        (0, 0)
      }
    }).reduce((a, b) => (a._1 + b._1, a._2 + b._2))

    // Calculate hit rate
    val hitRateValue = hitRate._1.toDouble / hitRate._2

    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top frequent queries to all nodes in the cluster.

The job then initializes a cache to store the queries and their timestamps. For each record in the onsite attributed data, it checks if the query is present in the top frequent queries dataset. If it is, it checks if the query is already in the cache. If it is, it checks if the query was accessed within the last 12 hours. If it was, it counts as a cache hit. If it wasn't, it counts as a cache miss and updates the cache with the new timestamp. If the query is not in the cache, it counts as a cache miss and updates the cache with the new timestamp.

Finally, the job calculates the hit rate by dividing the number of cache hits by the total number of queries processed.

