Here's an example of how you might write the `onSubmit` function for a form using React and Apollo Client for GraphQL:
```jsx
import React, { useState } from 'react';
import { useMutation } from '@apollo/client';
import { ADD_DATA } from './mutations';

const MyForm = () => {
  const [formState, setFormState] = useState({
    name: '',
    email: '',
    message: '',
  });

  const [addData, { data, loading, error }] = useMutation(ADD_DATA);

  const onSubmit = async (event) => {
    event.preventDefault();

    try {
      const { data } = await addData({ variables: { ...formState } });
      console.log('Data added successfully:', data);
      // Handle success, e.g. show a success message or redirect
    } catch (error) {
      console.error('Error adding data:', error);
      // Handle error, e.g. show an error message
    }
  };

  const onChange = (event) => {
    setFormState({
      ...formState,
      [event.target.name]: event.target.value,
    });
  };

  return (
    <form onSubmit={onSubmit}>
      <label>
        Name:
        <input type="text" name="name" onChange={onChange} />
      </label>
      <label>
        Email:
        <input type="email" name="email" onChange={onChange} />
      </label>
      <label>
        Message:
        <textarea name="message" onChange={onChange} />
      </label>
      <button type="submit">Submit</button>
    </form>
  );
};

export default MyForm;
```
In this example, we're using the `useMutation` hook from Apollo Client to execute a GraphQL mutation. The `ADD_DATA` mutation is imported from a separate file, which should contain the GraphQL query string.

The `onSubmit` function is called when the form is submitted. It prevents the default form submission behavior, then calls the `addData` function with the form state as variables. The `addData` function returns a promise that resolves to the mutation response, which is logged to the console in this example. If there's an error, it's caught and logged to the console.

