Static variables and register variables are two types of variables in C programming language.

1. Static Variables:
Static variables are variables that retain their value between function calls. They are declared using the keyword "static" and are initialized only once, at the first function call. After that, the value of the static variable is retained and not reinitialized in subsequent function calls.

Here is an example of a static variable:
